import './App.css';
import { AuthContextProvider } from './Context/AuthContext';
import {UserAuth} from './Context/AuthContext';
import {Log} from './Pages/LogScreen';

function App() {
  return (
    <AuthContextProvider>
      <Log/>
    </AuthContextProvider>
  );
}

export default App;
